import React, {useState} from 'react';
import ReactDom from 'react-dom'; 
import Board from "./Board"

let board = [];
for(let i = 0; i< 30; i++){
  board.push([]);
  for(let j = 0; j < 50; j++){
    board.push(Math.random() < .5 ? 1 : 0);
  }
}

const App = () => {

  return (<div>
    <Board/>
  </div>);

}


ReactDom.render(<App/>, document.getElementById('root'));
